import React from 'react';

export default function Overlay(){
    return(
        <div className="overlayOn overlayOff">
            <div className="overlay_card">
                <h3 className="overlay_title">Code:</h3>
                <p className="overlay_paragraph">Revisa tu correo</p>
                <input type="text" className="overlay_input"/>
                <button className="ovelay_button">Confirmar</button>
            </div>
        </div>
    )
}
